import styled from 'styled-components';

export const Disclaimer = styled.p`
    font-family: Monsterrat, sans-serif;
    font-size: 10px;
    text-align:center;
    font-style:italic;
`
export const Background = styled.div`
    background: #d3dbd3;
    border-radius:20px;
    margin:0px 200px;
    padding:10px;

`
